import friend from './Friend.module.css';
import FriendListElement from "./FriendListElement/FriendListElement";
function Friend(props) {
    let friendElement = props.friendsData.map(f => <FriendListElement username={f.username}/>)
    return(

        <div>
            <div className={friend.avatar}> {friendElement} </div>
        </div>
    );
}

export default Friend;
